uil-return-configuration-for-color (Color: text) = (item-or-value)
WS: class kb-workspace;
Tmp: class uil-scroll-message-configuration-class;
Config: item-or-value;
Found: truth-value = false;
begin
    Config = the symbol none;

    if (color-selector-configurations exists) then
        begin
        WS = the workspace of color-selector-configurations;

        for Tmp = each uil-scroll-message-configuration-class upon WS do
            if ("color-selector-[Color]-configuration" = "[the text of the names of Tmp]") then
                begin
                if ("[the uil-scroll-message-background-color of Tmp]" = Color) then
                    begin
                    Config = Tmp;
                    FOUND = true;
                    end;
                exit if FOUND;
                end;
            end;

        if not (FOUND) and (color-selector-4.0-configurations exists) then
            begin
            WS = the workspace of color-selector-4.0-configurations;

            for Tmp = each uil-configuration-class upon WS do
                if ("color-selector-[Color]-configuration" = "[the text of the names of Tmp]") then
                    begin
                    if ("[the uil-scroll-message-background-color of Tmp]" = Color) then
                        begin
                        Config = Tmp;
                        FOUND = true;
                        end;
                    exit if FOUND;
                    end;
                end;
            end;
        end;

    return Config;
end

uil-setup-color-selector-dialog (D: class uil-dialog, B: item-or-value, W: item-or-value, O: item-or-value, SL: class symbol-list)
SA: class uil-scroll-area;
DT: class uil-dialog-title;
MasterD: item-or-value;
TitleText, SelText, UnselText, AttText: text;
POS: integer;
S: symbol;
PI: class procedure-invocation;
SM: class uil-wait-semaphore; 
DEBUG: truth-value = false;
begin
if (DEBUG) then
    inform the operator that "Running uil-setup-color-selector-dialog";

    PI = this procedure-invocation;
    SM = call uil-post-delay-notification (W, PI, "");

    MasterD = call uil-get-master-dialog ("color-selector-dialog");
    if (MasterD is an item) then
        begin
        AttText = the user-data of MasterD;

        if (DEBUG) then
            inform the operator that "AttText = [AttText]";

        POS = position-of-text (",", AttText);
        TitleText = get-from-text (AttText, 1, POS - 1);

        if (DEBUG) then
            inform the operator that "TitleText: [TitleText]";

{-- Set Title --}
        for DT = each uil-dialog-title upon the subworkspace of D do
            call uil-update-text (DT, TitleText);
            end;

        if (DT exists and DT is a uil-dialog-title) then
            call uil-justify-dialog-title (DT, the workspace of DT);

        AttText = omit-from-text (AttText, 1, POS);
        POS = position-of-text (",", AttText);
        SelText = get-from-text (AttText, 2, POS - 1);
    
        if (DEBUG) then
            inform the operator that "SelText: [SelText]";

{-- Set uil-message-selection-method --}
        SA = the uil-scroll-area upon the subworkspace of D;

        if ("[SelText]" = "none") then
            conclude that the uil-message-selection-method of SA is uil-message-selection-method
        else
            begin
            if (DEBUG) then
                inform the operator that "setting selection-method to: [SelText]";

            S = symbol (SelText);
            conclude that the uil-message-selection-method of SA =  S;
            end;

        AttText = omit-from-text (AttText, 1, POS);        
        UnselText = get-from-text (AttText, 2, length-of-text (AttText));

        if (DEBUG) then
            inform the operator that "UnselText: [UnselText]";
           
{-- Set uil-message-unselection-method --}
        if ("[UnselText]" = "none") then
            conclude that the uil-message-unselection-method of SA is uil-message-unselection-method
        else
            begin
            if (DEBUG) then
                inform the operator that "setting unselection-method to: [UnselText]";

            S = symbol (UnselText);
            conclude that the uil-message-unselection-method of SA = S;
            end;   

        {-- ReSort Color Scroll-Area --}
        call uil-sort-scroll-area-messages (SA, the symbol priority);     
        end;

    call uil-remove-delay-notification-if-any (W); 
end

uil-set-color-selector-title (D: class uil-dialog, B: item-or-value, W: item-or-value, O: item-or-value, SL: class symbol-list)
DT: class uil-dialog-title;
MasterD: item-or-value;
begin
    MasterD = call uil-get-master-dialog ("color-selector-dialog");
    if (MasterD is an item) then
        begin
        for DT = each uil-dialog-title upon the subworkspace of D do
            call uil-update-text (DT, "[the user-data of MasterD]");
            end;

        if (DT exists and DT is a uil-dialog-title) then
            call uil-justify-dialog-title (DT, the workspace of DT);
        end;
end

uil-display-color-selector-dialog (InitObj: item-or-value, DT: text, SelectionMethod: item-or-value, UnselectionMethod: item-or-value, UserAction: symbol, W: class ui-client-item) = (item-or-value)
SA: class uil-scroll-area;
MO: class uil-message-object;
Color: item-or-value;
Actions: class symbol-array;
CSActions, NewActions: class uil-action-description-array;
T, ActionsText, AttText: text;
Len, Pos: integer;
MasterD, ColorD, ColorB: item-or-value;
DEBUG: truth-value = false;
begin
if (DEBUG) then
    inform the operator that "Running uil-display-color-selector-dialog";

    Color = the symbol none;

    MasterD = call uil-get-master-dialog ("color-selector-dialog");
    if (MasterD is an item) then
        begin
        AttText = DT;
        if (SelectionMethod exists) then
            AttText = "[AttText], [SelectionMethod]"
        else
            AttText = "[AttText], the symbol none";
            
        if (UnselectionMethod exists) then
            AttText = "[AttText], [UnselectionMethod]"
        else
            AttText = "[AttText], the symbol none";
            
        conclude that the user-data of MasterD = AttText;
        end;

    {-- Check for UserAction --}
    CSActions = uil-display-color-selector-actions;
    if (UserAction exists and the procedure named by UserAction exists) then
        begin
        create an uil-action-description-array NewActions by cloning uil-display-color-selector-actions;
        change the text of the names of NewActions to "cs-temp-actions";
        Actions = the uil-action-specifics of NewActions;
        ActionsText = the text of the initial-values of Actions;

        {inform the operator that "ActionsText: <[ActionsText]>";}

        Pos = position-of-text ("uil-call-update-method,", ActionsText);
        if (Pos /= 0) then
            begin
            ActionsText = insert-in-text (lower-case-text ("[UserAction], "), ActionsText, Pos + length-of-text ("uil-call-update-method,") + 1);

            {inform the operator that "ActionsText: <[ActionsText]>";}

            change the text of the initial-values of Actions to ActionsText;

            Len = the array-length of Actions;
            change the array-length of Actions to 0;
            change the array-length of Actions to Len + 1;

            CSActions = NewActions;
            end;
        end;
    
    ColorD, ColorB = call uil-control-dialog-callback ("color-selector-dialog", the symbol none, CSActions, InitObj, W);

    if (NewActions exists and NewActions is an item) then
        delete NewActions;

    if (ColorD exists and ColorD is a uil-dialog) then
        begin
        {-- Get the selected color --}
        SA = call uil-get-grobj-from-id-on-dlg-or-wksp ("color-selector-sa", ColorD);
        for MO = each uil-message-object that is a-selected-message-of SA do
            end;

        if (MO exists) then
            Color = the text of MO;

        call uil-release-dialog (ColorD, W, false);
        end;   

    return Color;
end

user-defined-display-color-selector-dialog-callback (B: class uil-button, W: class ui-client-item, WS: class item)
NewColor: item-or-value;
Config: item-or-value;
SelectionMethod: symbol = the symbol none;
UnSelectionMethod: symbol = the symbol none;
UserSetupAction: symbol = the symbol user-setup-color-selector-action;
begin
    NewColor = call uil-display-color-selector-dialog (B, "Window Color", SelectionMethod, UnSelectionMethod, UserSetupAction, W);

    if (NewColor exists) then
        inform the operator that "NewColor: <[NewColor]>";

   {-- Get configuration for selected color --}
    Config = call uil-return-configuration-for-color ("[NewColor]");

    if (Config is an item) then
        inform the operator that "text color for <[NewColor]> is: <[the uil-scroll-message-text-color of Config]>" 
end

user-procedure-to-display-color-selector (W: class ui-client-item)
NewColor: item-or-value;
SelectionMethod: symbol = the symbol none;
UnSelectionMethod: symbol = the symbol none;
UserSetupAction: symbol = the symbol user-setup-color-selector-action;
Config: item-or-value;
InitObj: item-or-value;
begin
    InitObj = the symbol none;

    NewColor = call uil-display-color-selector-dialog (InitObj, "Chart Color", SelectionMethod, UnSelectionMethod, UserSetupAction, W);

    if (NewColor exists) then
        inform the operator that "NewColor: <[NewColor]>";

    {-- Get configuration for selected color --}
    Config = call uil-return-configuration-for-color ("[NewColor]");

    if (Config is an item) then
        inform the operator that "text color for <[NewColor]> is: <[the uil-scroll-message-text-color of Config]>";
end
